  "title": {
    "nb": "Nasjonal vegdatabank API"
  },
  "description": {
    "nb": "Nasjonal vegdatabank er en database med informasjon om riks- og fylkesveger, kommunale veger, private veger og skogsbilveger. Databasen brukes aktivt i Norges vegforvaltning, og inneholder blant annet følgende informasjon:Vegnett med geometri og topologi som danner grunnlaget for kartløsninger og ruteberegnere på internettOversikt over utstyr og drenering langs vegenUlykker og trafikkmengderGrunnlagsdata for bruk i støyberegning og trafikkmodelleringAPIet er basert på REST, og kan brukes til å hente de fleste grunnlagsdata i Nasjonal vegdatabank (NVDB). Dataene leveres på XML- eller JSON-format. Eksempler på innhold i NVDB:Skilt, stikkrenner, belysningspunkt, kummer, rekkverk, skred, rasteplasser, tunneler, ferjekaier, trafikkulykker. I dag kan det hentes til sammen mer enn 16 millioner objekter, fordelt på over 250 objekttyper.Alle objekttyper i NVDB er beskrevet gjennom en egen datakatalog. Merk at det er objekttypenes ID, og ikke objekttypenes navn, som benyttes ved spørringer mot APIet.Det topologiske vegnettverket kan ikke hentes gjennom APIet på nåværende tidspunkt. De fleste data er tilknyttet europa-, riks- og fylkesveger. Et fåtall objekttyper er registrert på det øvrige vegnettet, blant annet fartsgrense. Alle objekttyper har en koordinat, for visning på kart.Informasjonen er også tilgjengelig i Vegkart, Statens vegvesens kartapplikasjon for å presentere data fra NVDB. For nyheter om NVDB, følg oss på twitter.com/NVDBapi. For nyheter, driftsmeldinger og tips om alle data fra Statens vegvesen, følg oss på twitter.com/VegvesenData."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eNasjonal vegdatabank er en database med informasjon om riks- og fylkesveger, kommunale veger, private veger og skogsbilveger. Databasen brukes aktivt i Norges vegforvaltning, og inneholder blant annet følgende informasjon:\u003c/p\u003e\u003cp\u003eVegnett med geometri og topologi som danner grunnlaget for kartløsninger og ruteberegnere på internett\u003c/p\u003e\u003cp\u003eOversikt over utstyr og drenering langs vegen\u003c/p\u003e\u003cp\u003eUlykker og trafikkmengder\u003c/p\u003e\u003cp\u003eGrunnlagsdata for bruk i støyberegning og trafikkmodellering\u003c/p\u003e\u003cp\u003eAPIet er basert på REST, og kan brukes til å hente de fleste grunnlagsdata i Nasjonal vegdatabank (NVDB). Dataene leveres på XML- eller JSON-format. Eksempler på innhold i NVDB:\u003c/p\u003e\u003cp\u003eSkilt, stikkrenner, belysningspunkt, kummer, rekkverk, skred, rasteplasser, tunneler, ferjekaier, trafikkulykker. I dag kan det hentes til sammen mer enn 16 millioner objekter, fordelt på over 250 objekttyper.\u003c/p\u003e\u003cp\u003eAlle objekttyper i NVDB er beskrevet gjennom en egen datakatalog. Merk at det er objekttypenes ID, og ikke objekttypenes navn, som benyttes ved spørringer mot APIet.\u003c/p\u003e\u003cp\u003eDet topologiske vegnettverket kan ikke hentes gjennom APIet på nåværende tidspunkt. De fleste data er tilknyttet europa-, riks- og fylkesveger. Et fåtall objekttyper er registrert på det øvrige vegnettet, blant annet fartsgrense. Alle objekttyper har en koordinat, for visning på kart.\u003c/p\u003e\u003cp\u003eInformasjonen er også tilgjengelig i \u003ca href\u003d\"http://vegkart.no\" rel\u003d\"nofollow\"\u003eVegkart\u003c/a\u003e, Statens vegvesens kartapplikasjon for å presentere data fra NVDB.\u003c/p\u003e\u003cp\u003e \u003c/p\u003e\u003cp\u003eFor nyheter om NVDB, følg oss på \u003ca href\u003d\"https://twitter.com/NVDBapi\" rel\u003d\"nofollow\"\u003etwitter.com/NVDBapi\u003c/a\u003e. For nyheter, driftsmeldinger og tips om alle data fra Statens vegvesen, følg oss på \u003ca href\u003d\"https://twitter.com/VegvesenData\" rel\u003d\"nofollow\"\u003etwitter.com/VegvesenData\u003c/a\u003e.\u003c/p\u003e"
  },
