  "title": {
    "nb": "Teknisk kjøretøyinformasjon"
  },
  "description": {
    "nb": "Teknisk kjøretøyinformasjon består av følgende hoveddatasett:Enkeltgodkjente kjøretøy (tekn): Alle enkeltgodkjente kjøretøy med teknisk informasjon og informasjon om registrering.Kjøretøyregistrering for typegodkjente kjøretøy (utek): Kjøretøy med informasjon om registrering (første og siste registrering), siste og neste EU-kontroll (periodisk kjøretøykontroll, PKK), og dato for utbetalt vrakpant.Typegodkjenninger (typg): Alle typegodkjenninger, med godkjenningsnummer og teknisk informasjon.For å finne teknisk informasjon for et typegodkjent kjøretøy må du:Bruke understellsnummer til å slå opp i «Kjøretøyregistrering for typegodkjente kjøretøy» (utek) og finne typegodkjenningsnummerBruke typegodkjenningsnummer til å slå opp i «Typegodkjenninger» (typg) for å finne teknisk informasjon for denne typenNB! Se utfyllende informasjon om kilometerstand.I tillegg er det flere hjelpedatasett som hoveddatasettene peker til.Du kan søke på understellsnummer i API-ene. Etter en personvernvurdering er det i første omgang besluttet at kjennemerker på kjøretøy ikke vil bli lagt ut. Trenger du data med kjennemerker kan du søke om innsyn i det sentrale motorvognregisteret."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eTeknisk kjøretøyinformasjon består av følgende hoveddatasett:\u003c/p\u003e\u003cul\u003e\u003cli\u003e\u003cstrong\u003eEnkeltgodkjente kjøretøy (tekn)\u003c/strong\u003e: Alle \u003ca href\u003d\"https://www.vegvesen.no/kjoretoy/Kjop+og+salg/import/Kommersiell+import+av+kjoretoy/Enkeltgodkjenning\" rel\u003d\"nofollow\"\u003eenkeltgodkjente\u003c/a\u003e kjøretøy med teknisk informasjon og informasjon om registrering.\u003c/li\u003e\u003cli\u003e\u003cstrong\u003eKjøretøyregistrering for typegodkjente kjøretøy (utek)\u003c/strong\u003e: Kjøretøy med informasjon om registrering (første og siste registrering), siste og neste EU-kontroll (periodisk kjøretøykontroll, PKK), og dato for utbetalt vrakpant.\u003c/li\u003e\u003cli\u003e\u003cstrong\u003eTypegodkjenninger (typg)\u003c/strong\u003e: Alle typegodkjenninger, med godkjenningsnummer og teknisk informasjon.\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eFor å finne teknisk informasjon for et typegodkjent kjøretøy må du:\u003c/p\u003e\u003col\u003e\u003cli\u003eBruke understellsnummer til å slå opp i\u003cstrong\u003e \u003c/strong\u003e«Kjøretøyregistrering for typegodkjente kjøretøy» (utek) og finne typegodkjenningsnummer\u003c/li\u003e\u003cli\u003eBruke typegodkjenningsnummer til å slå opp i «Typegodkjenninger» (typg) for å finne teknisk informasjon for denne typen\u003c/li\u003e\u003c/ol\u003e\u003cp\u003eNB! Se utfyllende informasjon om \u003ca href\u003d\"https://www.vegvesen.no/kjoretoy/Kjop+og+salg/Kj%C3%B8ret%C3%B8yopplysninger/Om+tjenesten/om-km.stand-i-kj%C3%B8ret%C3%B8yopplysninger/Om-kilometerstand-i-Kjoretoyopplysninger\" rel\u003d\"nofollow\"\u003ekilometerstand\u003c/a\u003e.\u003c/p\u003e\u003cp\u003eI tillegg er det flere hjelpedatasett som hoveddatasettene peker til.\u003c/p\u003e\u003cp\u003eDu kan søke på understellsnummer i API-ene. Etter en personvernvurdering er det i første omgang besluttet at kjennemerker på kjøretøy ikke vil bli lagt ut. Trenger du data med kjennemerker kan du \u003ca href\u003d\"https://www.vegvesen.no/om+statens+vegvesen/om+organisasjonen/apne-data/api-for-kjoretoyopplysninger/utlevering-av-kjoretoyopplysninger\" rel\u003d\"nofollow\"\u003esøke om innsyn i det sentrale motorvognregisteret\u003c/a\u003e.\u003c/p\u003e"
