  "title": {
    "nb": "Trafikkinformasjon på DATEX-format"
  },
  "description": {
    "nb": "Statens vegvesen tilbyr sanntids værdata, reisetider, kamerabilder samt vegmeldinger som inneholder informasjon om hendelser, vegarbeid og kjøreforhold via DATEX II versjon 2.0. DATEX (specification for DATa EXchange between traffic and travel information centres) er en europeisk standard for utveksling av trafikkinformasjon mellom ulike aktører, og baserer seg på XML-meldinger.NB! Følgende av dagens tjenester fra Statens vegvesen vil eksistere parallelt med Datex II en periode, men vil etter hvert bli utfaset: TrafikkmeldingerFor driftsmeldinger, generell informasjon og nyheter om Datex-noden i Statens vegvesen, se informasjon på norsk eller engelsk.For nyheter, driftsmeldinger og tips om alle data fra Statens vegvesen, følg oss på twitter.com/VegvesenData."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eStatens vegvesen tilbyr sanntids værdata, reisetider, kamerabilder samt vegmeldinger som inneholder informasjon om hendelser, vegarbeid og kjøreforhold via DATEX II versjon 2.0. DATEX (specification for DATa EXchange between traffic and travel information centres) er en europeisk standard for utveksling av trafikkinformasjon mellom ulike aktører, og baserer seg på XML-meldinger.\u003c/p\u003e\u003cp\u003e\u003cstrong\u003eNB! Følgende av dagens tjenester fra Statens vegvesen vil eksistere parallelt med Datex II en periode, men vil etter hvert bli utfaset: \u003c/strong\u003e\u003c/p\u003e\u003cp\u003e\u003cstrong\u003e\u003ca href\u003d\"https://data.norge.no/data/statens-vegvesen/utfases-trafikkmeldinger-helgetrafikken-inn-mot-oslo\" rel\u003d\"nofollow\"\u003eTrafikkmeldinger\u003c/a\u003e\u003c/strong\u003e\u003c/p\u003e\u003cp\u003eFor driftsmeldinger, generell informasjon og nyheter om Datex-noden i Statens vegvesen, se \u003ca href\u003d\"http://www.vegvesen.no/Om+Statens+vegvesen/Om+organisasjonen/For+utviklere+API/Datex/info-og-nyheter\" rel\u003d\"nofollow\"\u003einformasjon på norsk\u003c/a\u003e eller \u003ca href\u003d\"http://www.vegvesen.no/en/Traffic/On+the+road/Datex2/information-and-news\" rel\u003d\"nofollow\"\u003eengelsk\u003c/a\u003e.\u003c/p\u003e\u003cp\u003eFor nyheter, driftsmeldinger og tips om alle data fra Statens vegvesen, følg oss på \u003ca href\u003d\"https://twitter.com/VegvesenData\" rel\u003d\"nofollow\"\u003etwitter.com/VegvesenData\u003c/a\u003e.\u003c/p\u003e"
